sys_variable_value.value:
(function execute(inputs, outputs) {
    outputs.organization_id = inputs.organization_id.trim();
    var payload = {};
    payload["accountIds"] = inputs.account_ids;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

